import React from 'react';



const App = () => {
  return (
    <div>
      <header>
        <img src='https://upload.wikimedia.org/wikipedia/commons/5/52/Free_logo.svg'></img>
        </header>
        <nav>

          <div>Profile</div>
          <div>Massage</div>
        </nav>

        <div>
          Main content
        </div>

    </div>
  );
}
export default App;
